class Processdata extends Controller {

    public function getDropdowns() {

        $dropdown = new Dropdown();
        $getDropdowns = $dropdown->getDropdowns();

        return $getDropdowns;
    }

    public function getControls() {
        $control = new Control();
        $getAllControlsByProcessAndSede = $control
                ->getAllControlsByProcessAndSede();

        return $getAllControlsByProcessAndSede;
    }

    public function getProceses() {
        $process = new Process();
        $getProceses = $process
                ->getProceses();

        return $getProceses;
    }

    public function getSedes() {
        $process = new Sede();
        $getProceses = $process
                ->getSedes();

        return $getProceses;
    }

    public function getVarities() {
        $process = new Variety();
        $getProceses = $process
                ->getVarities();

        return $getProceses;
    }

    public function getComments() {
        $comment = new Comment();
        $getComments = $comment->getComments();

        return $getComments;
    }

    public function getFlowers() {
        $flower = new Flower();
        $getComments = $flower->getFlower();

        return $getComments;
    }

    public function getItems() {
        $item = new Item();
        $getItems = $item->getItems();

        return $getComments;
    }

    public function getEmployee() {
        $item = new Employee();
        $getItems = $item->getEmployees();

        return $getItems;
    }
public function saveData(Request $request){
$data=json_decode($request->all()["data"],true);    
    foreach ($data as $value) {
        $labor= new Labor();
        $labor->supervisor=$value["supervisor"];
        $labor->colaborator=$value["colaborator"];
        $labor->asegurator=$value["asegurator"];
        $labor->flower_type=$value["flowerType"];
        $labor->process=$value["process"];
        $labor->date_labor=$value["date"];
        $labor->state=$value["state"];
        $labor->subprocess=$value["subprocess"];
        $labor->blocks=$value["blocks"];
        $labor->user_id=1;
        $labor->muestras=$value["muestras"];
        $labor->variety=$value["variety"];
        
        $labor->comments=$value["comments"];
        $labor->id_labor=$value["id"];
        $labor->save();
    }
}

public function deleteLabor(Request $request){
$data=$request->all() ;   

   $labor= new Labor();
   $getLaborByUser=$labor->getLaborByUser($data["id"], $data["user_id"]);
   
   if($getLaborByUser){
       $getLaborByUser->delete();
   }
}

    public function processEmploys() {

        $curl = curl_init();

        curl_setopt_array($curl, array(
            CURLOPT_URL => 'https://grchia.azure-api.net/ghestor-calidad/v1.0/GetEmployees?p_std_id_legent=TR',
            CURLOPT_RETURNTRANSFER => true,
            CURLOPT_ENCODING => '',
            CURLOPT_MAXREDIRS => 10,
            CURLOPT_TIMEOUT => 0,
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            CURLOPT_CUSTOMREQUEST => 'GET',
            CURLOPT_POSTFIELDS => 'uid=0480c9bffa1e4fd3a616261c9518f016',
            CURLOPT_HTTPHEADER => array(
                'Ocp-Apim-Subscription-Key: c3c35631038f4eab8eda5bc88baffff1',
                'Content-Type: application/x-www-form-urlencoded'
            ),
        ));

        $response = curl_exec($curl);

        curl_close($curl);
        $data = json_decode($response, true);


        foreach ($data as $value) {
            $item = new Employee();
            $item->name = $value["SCO_GB_NAME"];

            if ($value["SCB_ID_SUCURSAL"] == "FE") {
                $item->sede_id = 2;
            } else {
                $item->sede_id = 1;
            }
            $item->position = $value["SCO_NM_POSITIONESP"];

            if (str_contains($value["SCO_NM_POSITIONESP"], 'OPERARIO')) {
                $item->type_position = "Operario";
            } else
            if (str_contains($value["SCO_NM_POSITIONESP"], 'SUPERVISOR')) {
                $item->type_position = "Supervisor";
            } else {
                $item->type_position = "Other";
            }


            $item->save();
        }
    }

